import React from 'react'
import './register.css'
import Paper from '@mui/material/Paper';

const Register = () => {
  return (
    <div className="main-screen-register h-screen w-screen flex flex-row justify-evenly">
        <div className='left-screen-register'>
        </div>
        <div className='right-screen-register justify-items-center'>
            <Paper sx={{
                textAlign:'center',
            }} elevation={6}>
                Register
            </Paper>
        </div>
    </div>
  )
}

export default Register
